    "# Funzione per calcolare betweenness centrality media\n",
    "def average_betweenness_centrality(G):\n",
    "    betweenness = nx.betweenness_centrality(G, weight='weight')\n",
    "    avg_betweenness = sum(betweenness.values()) / len(betweenness)\n",
    "    return avg_betweenness\n",
    "\n",
    "# Funzione per calcolare il flusso massimo tra tutti i nodi\n",
    "def maximum_flow(G):\n",
    "    max_flow_values = {}\n",
    "\n",
    "    for u in G.nodes():\n",
    "        for v in G.nodes():\n",
    "            if u != v:\n",
    "                try:\n",
    "                    flow_value, flow_dict = nx.maximum_flow(G, u, v, capacity='weight')\n",
    "                    max_flow_values[(u, v)] = flow_value\n",
    "                except nx.NetworkXError:\n",
    "                    max_flow_values[(u, v)] = 0  # Non esiste un cammino tra i due nodi\n",
    "\n",
    "    # Restituisce il flusso massimo medio\n",
    "    return sum(max_flow_values.values()) / len(max_flow_values)\n",
    "\n",
    "# Funzione per analizzare la resilienza alla rimozione di un nodo\n",
    "def analyze_resilience_node_removal(G, node):\n",
    "    if not G.has_node(node):\n",
    "        print(f\"Il nodo {node} non esiste nel grafo.\")\n",
    "        return\n",
    "\n",
    "    # Cloniamo il grafo\n",
    "    G_removed = G.copy()\n",
    "    G_removed.remove_node(node)\n",
    "\n",
    "    # Calcolo delle metriche prima e dopo la rimozione del nodo\n",
    "    largest_cc_size_before = len(max(nx.connected_components(G), key=len))\n",
    "    largest_cc_size_after = len(max(nx.connected_components(G_removed), key=len))\n",
    "\n",
    "    try:\n",
    "        avg_shortest_path_before = nx.average_shortest_path_length(G.subgraph(max(nx.connected_components(G), key=len)))\n",
    "        avg_shortest_path_after = nx.average_shortest_path_length(G_removed.subgraph(max(nx.connected_components(G_removed), key=len)))\n",
    "    except nx.NetworkXError:\n",
    "        avg_shortest_path_before = None\n",
    "        avg_shortest_path_after = None\n",
    "\n",
    "    # Calcolo della betweenness centrality media\n",
    "    avg_betweenness_before = average_betweenness_centrality(G)\n",
    "    avg_betweenness_after = average_betweenness_centrality(G_removed)\n",
    "\n",
    "    # Calcolo del flusso massimo\n",
    "    max_flow_before = maximum_flow(G)\n",
    "    max_flow_after = maximum_flow(G_removed)\n",
    "\n",
    "    return {\n",
    "        'largest_cc_size_before': largest_cc_size_before,\n",
