    "\n",
    "# Function to add edges based on mobility matrix\n",
    "def add_edges(city1, city_data, mobility_matrix):\n",
    "    edges = []\n",
    "    for _, city2 in city_data.iterrows():\n",
    "        if city1['city'] < city2['city']:  # To avoid duplicate edges (both directions)\n",
    "            try:\n",
