    "# Funzione per calcolare la robustezza locale di un nodo\n",
    "def local_robustness(G, node):\n",
    "    # Rimuovi un nodo e controlla quante connessioni rimangono attive nel vicinato\n",
    "    if G.has_node(node):\n",
    "        neighbors = list(G.neighbors(node))\n",
    "        if len(neighbors) <= 1:\n",
    "            return 0  # Nessun vicinato significativo\n",
    "        subgraph = G.subgraph(neighbors)\n",
    "        robustness = len(max(nx.connected_components(subgraph), key=len)) / len(neighbors)\n",
    "        return robustness\n",
    "    return None"
