    "# Funzione per calcolare l'efficienza globale della rete\n",
    "def global_efficiency(G):\n",
    "    # L'efficienza globale è la media del reciproco delle distanze tra tutti i nodi\n",
    "    efficiency = 0\n",
    "    n = len(G)\n",
    "    for u in G.nodes():\n",
    "        for v in G.nodes():\n",
    "            if u != v:\n",
    "                try:\n",
    "                    shortest_path_length = nx.shortest_path_length(G, u, v, weight='weight')\n",
    "                    efficiency += 1 / shortest_path_length\n",
    "                except nx.NetworkXNoPath:\n",
    "                    continue  # Nessun cammino tra u e v\n",
    "    return efficiency / (n * (n - 1))\n"
