    "import streamlit as st\n",
    "import pandas as pd\n",
    "import networkx as nx\n",
    "import pydeck as pdk\n",
    "\n",
    "# Function to create the graph\n",
    "def create_graph(df_nodes, df_links):\n",
    "    G = nx.Graph()\n",
    "    for idx, row in df_nodes.iterrows():\n",
    "        G.add_node(row['Id'], label=row['Label'], pos=(row['longitude'], row['latitude']))\n",
    "    for idx, row in df_links.iterrows():\n",
    "        G.add_edge(row['source'], row['target'], weight=row['weight'])\n",
    "    return G\n",
    "\n",
    "# Function to create the map\n",
    "def create_map(df_nodes, df_links):\n",
    "    node_layer = pdk.Layer(\n",
    "        'ScatterplotLayer',\n",
    "        data=df_nodes,\n",
    "        get_position='[longitude, latitude]',\n",
    "        get_color='[200, 30, 0, 160]',\n",
    "        get_radius=500,\n",
    "        pickable=True\n",
    "    )\n",
    "\n",
    "    edge_data = pd.DataFrame({\n",
    "        'start_lon': df_links['source_lon'],\n",
    "        'start_lat': df_links['source_lat'],\n",
    "        'end_lon': df_links['target_lon'],\n",
    "        'end_lat': df_links['target_lat']\n",
    "    })\n",
    "\n",
    "    edge_layer = pdk.Layer(\n",
    "        \"LineLayer\",\n",
    "        data=edge_data,\n",
    "        get_source_position='[start_lon, start_lat]',\n",
    "        get_target_position='[end_lon, end_lat]',\n",
    "        get_color=[0, 0, 255, 200],\n",
    "        get_width=2\n",
    "    )\n",
    "\n",
    "    view_state = pdk.ViewState(\n",
    "        latitude=df_nodes['latitude'].mean(),\n",
    "        longitude=df_nodes['longitude'].mean(),\n",
    "        zoom=6,\n",
    "        pitch=0\n",
    "    )\n",
    "\n",
    "    map_deck = pdk.Deck(\n",
    "        layers=[node_layer, edge_layer],\n",
    "        initial_view_state=view_state,\n",
    "        tooltip={\"text\": \"{Label}\"}\n",
    "    )\n",
    "\n",
    "    st.pydeck_chart(map_deck)\n",
    "\n",
    "# Resilience analysis function\n",
    "def analyze_resilience_node_removal(G, selected_node):\n",
    "    # Create a temporary graph without the selected node\n",
    "    G_temp = G.copy()\n",
    "    G_temp.remove_node(selected_node)\n",
    "    \n",
    "    # Metrics calculations\n",
    "    largest_cc_before = max(nx.connected_components(G), key=len)\n",
    "    largest_cc_after = max(nx.connected_components(G_temp), key=len) if len(G_temp.nodes) > 0 else 0\n",
    "    \n",
    "    avg_shortest_path_before = nx.average_shortest_path_length(G.subgraph(largest_cc_before)) if len(largest_cc_before) > 1 else 0\n",
    "    avg_shortest_path_after = nx.average_shortest_path_length(G_temp.subgraph(largest_cc_after)) if len(largest_cc_after) > 1 else 0\n",
    "\n",
    "    betweenness_centrality_before = nx.betweenness_centrality(G)\n",
    "    avg_betweenness_before = sum(betweenness_centrality_before.values()) / len(betweenness_centrality_before)\n",
    "    \n",
    "    betweenness_centrality_after = nx.betweenness_centrality(G_temp)\n",
    "    avg_betweenness_after = sum(betweenness_centrality_after.values()) / len(betweenness_centrality_after) if len(betweenness_centrality_after) > 0 else 0\n",
    "\n",
